import React from 'react';
import {Button, Navbar, Nav, NavDropdown} from 'react-bootstrap'
import { Router, Route, Link, Switch } from 'react-router'
import logo from './logo.svg';
import './App.css';
//import '@fontawesome/fontawesome-free/css/all.css'

class Header extends React.Component{
  render(){
    return(
      <header className="App-header">
        <div>
          <i className="fas fa-flask m-3 p-4" style={{
            fontSize: "10rem",
            color: "#blue"
          }}></i></div>
        <div>
          <h1>Northwest Labs</h1>

          <h3>Where all you chemical testing dreams come true!</h3>
        </div>
        <Button variant="success" size="lg" style={{margin: "2rem"}}>Get Started today!</Button>
      </header>
    )
  }
}

class Footer extends React.Component{
  render(){
    var today = new Date();

    return(
      <div>
          <h6> Â© {today.getFullYear()} Northwest Labs</h6>
      </div>
    )
  }
}

function Home() {
  return(
    <div>
      <Header/>
      <h1>Home Page</h1>
      <p>This is some other content that we can put on here</p>
      <Footer/>
    </div>
  )
}
function About() {
  return(
    <div>
      <Header/>
      <h1>About Page</h1>
      <p>This is some other content that we can put on here</p>
      <Footer/>
    </div>
  )
}
function Contact() {
  return(
    <div>
      <Header/>
      <h1>Contact Page</h1>
      <p>This is some other content that we can put on here</p>
      <Footer/>
    </div>
  )
}

function App() {
  return (
    <Rounter>
      <div className="App">
        <Navbar bg="success" variant="light" expand="lg">
          <Navbar.Brand href="/"><i class="fas fa-flask"></i> NW Labs</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link href="/about">About</Nav.Link>
              <Nav.Link href="/contact">Contact</Nav.Link>
              <NavDropdown title="Services" id="basic-nav-dropdown">
                <NavDropdown.Item href="#">Service 1</NavDropdown.Item>
                <NavDropdown.Item href="#">Service 2</NavDropdown.Item>
                <NavDropdown.Item href="#">Something</NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#">Separated link</NavDropdown.Item>
              </NavDropdown>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
        <Switch>
          <Route exact path="/">
            <Home/>
          </Route>
          <Route path="/about">
            <About/>
          </Route>
          <Route path="/contact">
            <Contact/>
          </Route>
        </Switch>
        <Header/>
        <p>This is some other content that we can put on here</p>
        <Footer/>
      </div>
    </Rounter>
  );
}

export default App;
